A Heavy Nite With... is the debut album by British band Relaxed Muscle fronted by Pulp&amp;#039;s Jarvis Cocker, using the pseudonym Darren Spooner. The other member is Jason Buckle. It has been alleged that Jason Buckle is a pseudonym for Pulp guitarist Richard Hawley, but this is not the case - Hawley does contribute guitar to the album, however, under the pseudonym Wayne Marsden.

Relaxed Muscle&amp;#039;s music is not similar to Pulp, it is closer to the Fat Truckers crude electro.
